  <Box
    sx={{
      maxWidth: 500,
      mx: "auto",
      p: 3,
      border: "1px",
      borderColor: "lightpink",
      borderStyle: "solid",
    }}
  >
              <Heading>
                About
        </Heading>
  </Box>
)
